import $ from "jquery";
import { homedir } from "os";

$(document).ready(function() {
  loadAll();
});

class HomeScript{
    loadAll = () => {
        var ammount = 0;
        $.ajax({
          type: "GET",
          url: "http://localhost:4242/api/1.0/length",
          dataType: "json",
          success: function(response) {
            ammount = response.length;
            for (var i = 0; i < ammount; i++) {
              $.ajax({
                type: "POST",
                url: "http://localhost:4242/api/1.0/get",
                dataType: "json",
                async: false,
                data: {
                  itteration: i
                },
                success: function(response) {
                  console.log(response);
                  if (response.level == 1) {
                    $(".child-page-listing").append(
                      $('<article class="location-listing">').append(
                        $('<a class="location-title">').text(response.title),
                        $('<div class="location-image">').append(
                          $("<a>").append(
                            $(
                              '<img class="thumbnail" src="data:image/png;base64,' +
                                response.thumbnail +
                                '">'
                            )
                          )
                        )
                      )
                    );
                  } else {
                    $(".child-page-listing").append(
                      $('<article class="location-listing">').append(
                        $('<a class="location-title">').text(response.title),
                        $('<div class="location-image">').append(
                          $("<a>").append(
                            $(
                              '<img class="thumbnail" src="data:image/png;base64,' +
                                response.thumbnail +
                                '">'
                            )
                          )
                        )
                      )
                    );
                  }
                },
                error: function() {}
              });
            }
          },
          error: function() {}
        });
      }
}



export default HomeScript;
